_modules.uiModules.get('xpack/logstash').factory('logstashLicenseService', function ($injector) {
  var Private = $injector.get('Private');
  var xpackInfoService = Private(_xpack_info.XPackInfoProvider);
  var kbnUrlService = $injector.get('kbnUrl');
  var $timeout = $injector.get('$timeout');

  return new _logstash_license_service.LogstashLicenseService(xpackInfoService, kbnUrlService, $timeout);
});
